import React from "react";
import { Tab, Tabs } from "react-bootstrap";
import { Container, Row, Col } from 'react-bootstrap';


function Player({ data }) {
  return (
    <div>
      <h2>Leage Admin Page</h2>
      <Tabs defaultActiveKey="home" id="admin-tabs" className="mb-3">
      <Tab eventKey="home" title="Home">
          <h3>Home Page</h3>
        </Tab>
        <Tab eventKey="player" title="Players">
          <PlayersInfo data={data}></PlayersInfo>
        </Tab>
      </Tabs>
    </div>
  );
}

function PlayersInfo({ data }) {
  return (
    <Container className="player-info-container">
      <h3>Your Details Below</h3>
      <Row className="player-info-item">
        <Col xs={4} className="player-info-label">Name:</Col>
        <Col xs={8} className="player-info-value">{data.name}</Col>
      </Row>
      <Row className="player-info-item">
        <Col xs={4} className="player-info-label">Team Name:</Col>
        <Col xs={8} className="player-info-value">{data.team}</Col>
      </Row>
      <Row className="player-info-item">
        <Col xs={4} className="player-info-label">Your Average Score:</Col>
        <Col xs={8} className="player-info-value">{data.average_score}</Col>
      </Row>
      <Row className="player-info-item">
        <Col xs={4} className="player-info-label">Number of games played:</Col>
        <Col xs={8} className="player-info-value">{data.games_participated}</Col>
      </Row>


    </Container>
  );
}

export default Player;
